const events = [
    {
        id: 1,
        text: 'Example 1',
        date: '01/02/2023'    
    },
    {
        id: 2,
        text: 'Example 2',
        date: '01/03/2023'    
    },
    {
        id: 3,
        text: 'Example 3',
        date: '01/24/2023'    
    }
]

const Events = () => {
  return (
    <>
        {events.map((event) => (
            <h3>{event.text}</h3>
        ))}
    </>
  )
}

export default Events
